  false,\n\t\"url\": null,\n\t\"notes\": \"Current direction, wind wave spectra, phytoplankton,
  temperature, salinity, and other data were collected using moored current meter
  casts in the Gulf of Mexico from the SW RESEARCHER and PEARL from September 24,
  1977 to May 31, 1981. Data were submitted by National Data Buoy Center (NDBC) as
  part of the Brine Disposal project. Data has been been processed by NODC to the
  NODC standard F005- Current Meter Data, F028- Phytoplankton, and F191 Wind Wave
  Spectra formats. Full format and format code descriptions are available at http://www.nodc.noaa.gov/General/NODC-datafmts.html.nnThe
  F005 format is used for time series measurements of ocean currents obtained using
  moored current-measuring instruments, principally Aanderaa current meters (manufactured
  by Aanderaa Instruments Inc.). These data represent the Eulerian method of current
  measurement, i.e., the meters are deployed at a fixed mooring point and measure
  flow past the sensor. Position, water depth, and sensor depth are reported for each
  station. The data record comprises values of current direction and speed at specified
  date and time. Data values may be subject tonaveraging or filtering and are typically
  reported at 10-15 minute time intervals. Other environmental parameters may also
  be reported. These include: water temperature, salinity, conductivity, and transmissivity;
  wind direction and speed; and dominant wave direction, height, and period. A text
  field is available for optional comments.nnThe F028 format is used for data from
  the sampling and analysis of marine phytoplankton. Information on phytoplankton
  abundance, distribution, and productivity derived from these data support studies
  of marine populations and ecosystems. Data reported may include: position, date,
  and time of sampling; bottom depth and sampling depths; volume of water filtered;
  and concentration of cells, carbon concentration, wet and dry weight, and counts
  for each species reported. Comments may be relayed in a text record.nnThe F191 format
  is used to report meteorological data and ocean wave spectra data from NDBC. The
  format contains seven data record types to: 1) Identify the buoy for position, duration,
  rate of sampling and heading. 2) Identify the meteorological parameters (temperature,
  pressure, weather, solar radiation, and surface waves). 3) Report time series frequency,
  density and resolution of waves. Each record is 120 characters in length, sorted
  by station and record type. The first nine columns for all records are to be used
  for file type (columns 1-3) and file identifier (column 4-9). The file identifier,
  to be assigned by the originator, is an unique originator id for each data submission.
  After submission, the NODC reassigns to this field an unique NODC identifier for
  internal use.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
